import React from "react"
//import {SimpleCarousel} from './Carousel';

export default function Home(){
    return (
        <div>
            <p className="mainSection">Team RoboTO is the official team representing Politecnico di Torino in the prestigious DJI Robomaster University Series robotics competitions. Our mission is to create a coalition of engineering students from different fields, passionate about robotics and technology, with the common goal of building state-of-the-art robots in a challenging and immersive context. And you? Are you passionate about robotics?</p>

        </div>
    )
}
